import React, { Component } from 'react';
import {DataTable} from 'primereact/datatable';
import {Column} from 'primereact/column';
import { Card } from 'primereact/card';

class Datatable extends Component {

    constructor() {
        super();
        this.state = {
            representatives: [
                {field: "Country", header: "Country"},
                {field: "TotalConfirmed", header: 'Infected'},
                {field: "TotalDeaths", header:'Deaths'},
                {field: "TotalRecovered", header:'Recovered'}
                
            ]

                
            
        };
    }


    render() {
        const { summaryCountries, currentDate } = this.props;

        let cols = [
            {field: "Country", header: "Country"},
            {field: "Anna Fali", header: 'annafali.png'},
            {field: "Asiya Javayant", image: 'asiyajavayant.png'},
            {field: "Bernardo Dominic", image: 'bernardodominic.png'},
            {field: "Elwin Sharvill", image: 'elwinsharvill.png'},
            {field: "Ioni Bowcher", image: 'ionibowcher.png'},
            {field: "Ivan Magalhaes",image: 'ivanmagalhaes.png'},
            {field: "Onyama Limba", image: 'onyamalimba.png'},
            {field: "Stephen Shaw", image: 'stephenshaw.png'},
            {field: "XuXue Feng", image: 'xuxuefeng.png'}
        ];

        let dynamicColumns = this.state.representatives.map((col) => {
            return <Column field={col.field} header={col.header} />;
        });

        return (
            
            <Card>   
                
            <DataTable value={summaryCountries}>
            {dynamicColumns}
        </DataTable>
        </Card> 
        );
    }
}

export default Datatable;
